// see all possible matchers at
// https://sinonjs.org/releases/latest/matchers/
var greeter = {
  /**
   * Greets a person
   * @param {string} name
   */
  greet: function greet(name) {
    return "Hello, ".concat(name, "!");
  }
};
cy.stub(greeter, "greet").callThrough() // if you want non-matched calls to call the real method
.withArgs(Cypress.sinon.match.string).returns("Hi").withArgs(Cypress.sinon.match.number)["throws"](new Error("Invalid name"));
expect(greeter.greet("World")).to.equal("Hi"); // @ts-ignore
expect(function () {
  return greeter.greet(42);
}).to["throw"]("Invalid name");
expect(greeter.greet).to.have.been.calledTwice; // non-matched calls goes the actual method
// @ts-ignore
expect(greeter.greet()).to.equal("Hello, undefined!");

// see all possible matchers at
// https://sinonjs.org/releases/latest/matchers/
var calculator = {
  /**
   * returns the sum of two arguments
   * @param a {number}
   * @param b {number}
   */
  add: function add(a, b) {
    return a + b;
  }
};
var spy = cy.spy(calculator, "add").as("add");
expect(calculator.add(2, 3)).to.equal(5); // if we want to assert the exact values used during the call
expect(spy).to.be.calledWith(2, 3); // let's confirm "add" method was called with two numbers
expect(spy).to.be.calledWith(Cypress.sinon.match.number, Cypress.sinon.match.number); // alternatively, provide the value to match
expect(spy).to.be.calledWith(Cypress.sinon.match(2), Cypress.sinon.match(3)); // match any value
expect(spy).to.be.calledWith(Cypress.sinon.match.any, 3); // match any value from a list
expect(spy).to.be.calledWith(Cypress.sinon.match["in"]([1, 2, 3]), 3);
/**
 * Returns true if the given number is event
 * @param {number} x
 */
var isEven = function isEven(x) {
  return x % 2 === 0;
}; // expect the value to pass a custom predicate function
// the second argument to "sinon.match(predicate, message)" is
// shown if the predicate does not pass and assertion fails

expect(spy).to.be.calledWith(Cypress.sinon.match(isEven, "isEven"), 3);
/**
 * Returns a function that checks if a given number is larger than the limit
 * @param {number} limit
 * @returns {(x: number) => boolean}
 */
var isGreaterThan = function isGreaterThan(limit) {
  return function (x) {
    return x > limit;
  };
};
/**
 * Returns a function that checks if a given number is less than the limit
 * @param {number} limit
 * @returns {(x: number) => boolean}
 */

var isLessThan = function isLessThan(limit) {
  return function (x) {
    return x < limit;
  };
}; // you can combine several matchers using "and", "or"

expect(spy).to.be.calledWith(Cypress.sinon.match.number, Cypress.sinon.match(isGreaterThan(2), "> 2").and(Cypress.sinon.match(isLessThan(4), "< 4")));
expect(spy).to.be.calledWith(Cypress.sinon.match.number, Cypress.sinon.match(isGreaterThan(200), "> 200").or(Cypress.sinon.match(3))); // matchers can be used from BDD assertions
cy.get("@add").should("have.been.calledWith", Cypress.sinon.match.number, Cypress.sinon.match(3)); // you can alias matchers for shorter test code
var M = Cypress.sinon.match;
cy.get("@add").should("have.been.calledWith", M.number, M(3));
